import React from 'react';
import '../styles/logo.style.scss';

function Home() {
	function click() {}
	return (
		<>
			<div className="logo-holder flex-col">
				<div className="flex-row">
					<span>SKY</span>
					<span>LAB</span>

					<span>[</span>
					<span>HIRED!</span>
					<span style={{ color: 'green' }}>]</span>
				</div>
			</div>
		</>
	);
}

export default Home;
